import Axios from 'axios';

function SearchBar(searchTerm, stateFunction, submitFunction) {

    const SearchLogins = () => {
        Axios.post("http://localhost:4500/search-result", {
            searchTerm: searchTerm
   })
   .then(function(response) {
     console.log(response);
   })
   .catch(function(error) {
     console.log(error);
   })
 };
  return (
        <form className="d-flex" role="search">
            <input 
            className="form-control me-2" 
            type="search" placeholder="Search" 
            aria-label="Search" 
            name="searchTerm" 
            id="searchTerm"
            value={searchTerm}
            onChange={stateFunction}/>
            <button onClick={submitFunction} className="btn btn-outline-light" type="submit">Search</button>
        </form> 
  );
};

export default SearchBar
